import { combineReducers } from "redux";
import setPlanPriceReducer from "./setPlanPrice";
import setRepairPriceReducer from "./setRepairPrice";

const setTotalPriceReducer = combineReducers({
    a: setPlanPriceReducer,
    b: setRepairPriceReducer
})

export default setTotalPriceReducer;
